import React from 'react'
import classes from './customerAddressCards.module.css';
const customerAddressCards=(props)=> {
    return (
        <div className={classes.Card}> 
            <div className={classes.Container}>
            <h2>City    :  {props.city}</h2>
            <h2>state    :  {props.state}</h2>
            <h2>country    :  {props.country}</h2>
            <h2>zipcode    :  {props.zipcode}</h2>
            <h2>addressLine    :  {props.addressLine}</h2>

            </div>
      </div>
    )
}

export default customerAddressCards
